import React from 'react'
import { ReactDOM } from 'react';
let numbers = [1, 2, 3, 4, 5];
let listItems = numbers.map((number) => <li>{number}</li>);

const Item = (
    <ul>{listItems}</ul>
)

const addQuestion = () => {
    numbers.push(1);
    listItems = numbers.map((number) => <li>{number}</li>);
    ReactDOM.render(<ul>{listItems}</ul>, document.getElementById("root"));
  return (alert( numbers ));
};

export const CreateTest = () => {
    return (
      <div id = "root" className='Content'>
        <div className="Create">
            <div className="CreateHeader">
                <h1>Составь вопросы</h1>
                <div className="MainCreate">
                    <img src={'./img/createtest.jpg'} alt="" className='CreateImg'/>
                    <div className="CreateQuestions">
                        <form>
                            <p>Название</p>
                            <input type="text" className="QuestHeader" />
                            <p>Описание</p>
                            <input type="text" className="QuestMessage" />
                        </form>
                    </div>
                    <div >
                        <button onClick={() => addQuestion()}>Add</button>
                        <Item></Item>
                    </div>
                    
    
                </div>
            </div>
            
            
            
        </div>
      </div>
    )
  }
